INSERT INTO `wp_wc_admin_notes` VALUES("44", "woocommerce-WCstripe-May-2023-updated-needed", "update", "en_US", "Action required: Security update of WooCommerce Stripe plugin", "<strong>Your store requires a security update for the WooCommerce Stripe plugin</strong>. Please update the WooCommerce Stripe plugin immediately to address a potential vulnerability.", "{}", "pending", "woocommerce.com", "2024-01-02 04:42:22", NULL, "0", "plain", "", "0", "0", "info");
INSERT INTO `wp_wc_admin_notes` VALUES("45", "woocommerce-WCPayments-June-2023-updated-needed", "update", "en_US", "Action required: Security update of WooCommerce Payments", "<strong>Your store requires a security update for the WooCommerce Payments plugin</strong>. Please update the WooCommerce Payments plugin immediately to address a potential vulnerability.", "{}", "pending", "woocommerce.com", "2024-01-02 04:42:22", NULL, "0", "plain", "", "0", "0", "info");
INSERT INTO `wp_wc_admin_notes` VALUES("46", "woocommerce-WCSubscriptions-June-2023-updated-needed", "marketing", "en_US", "Action required: Security update of WooCommerce Subscriptions", "<strong>Your store requires a security update for the WooCommerce Subscriptions plugin</strong>. Please update the WooCommerce Subscriptions plugin immediately to address a potential vulnerability.", "{}", "pending", "woocommerce.com", "2024-01-02 04:42:22", NULL, "0", "plain", "", "0", "0", "info");
INSERT INTO `wp_wc_admin_notes` VALUES("47", "woocommerce-WCReturnsWarranty-June-2023-updated-needed", "update", "en_US", "Action required: Security update of WooCommerce Returns and Warranty Requests extension", "<strong>Your store requires a security update for the Returns and Warranty Requests extension</strong>.  Please update to the latest version of the WooCommerce Returns and Warranty Requests extension immediately to address a potential vulnerability discovered on May 31.", "{}", "pending", "woocommerce.com", "2024-01-02 04:42:22", NULL, "0", "plain", "", "0", "0", "info");
INSERT INTO `wp_wc_admin_notes` VALUES("48", "woocommerce-WCOPC-June-2023-updated-needed", "update", "en_US", "Action required: Security update of WooCommerce One Page Checkout", "<strong>Your shop requires a security update to address a vulnerability in the WooCommerce One Page Checkout extension</strong>. The fix for this vulnerability was released for this extension on June 13th. Please update immediately.", "{}", "pending", "woocommerce.com", "2024-01-02 04:42:22", NULL, "0", "plain", "", "0", "0", "info");
INSERT INTO `wp_wc_admin_notes` VALUES("49", "woocommerce-WCGC-July-2023-update-needed", "update", "en_US", "Action required: Security update of WooCommerce GoCardless Extension", "<strong>Your shop requires a security update to address a vulnerability in the WooCommerce GoCardless extension</strong>. The fix for this vulnerability was released on July 4th. Please update immediately.", "{}", "pending", "woocommerce.com", "2024-01-02 04:42:22", NULL, "0", "plain", "", "0", "0", "info");
INSERT INTO `wp_wc_admin_notes` VALUES("50", "woocommerce-shipping-fedex-api-outage-2023-07-16", "warning", "en_US", "Scheduled FedEx API outage  July 2023", "On July 16 there will be a full outage of the FedEx API from 04:00 to 08:00 AM UTC. Due to planned maintenance by FedEx, you\'ll be unable to provide FedEx shipping rates during this time. Follow the link below for more information and recommendations on how to minimize impact.", "{}", "pending", "woocommerce.com", "2024-01-02 04:42:22", NULL, "0", "plain", "", "0", "0", "info");
INSERT INTO `wp_wc_admin_notes` VALUES("51", "wcship-2023-07-hazmat-update-needed", "update", "en_US", "Action required: USPS HAZMAT compliance update for WooCommerce Shipping & Tax extension", "<strong>Your store requires an update for the WooCommerce Shipping extension</strong>. Please update to the latest version of the WooCommerce Shipping &amp; Tax extension immediately to ensure compliance with new USPS HAZMAT rules currently in effect.", "{}", "pending", "woocommerce.com", "2024-01-02 04:42:22", NULL, "0", "plain", "", "0", "0", "info");
INSERT INTO `wp_wc_admin_notes` VALUES("52", "woocommerce-WCStripe-Aug-2023-update-needed", "update", "en_US", "Action required: Security update for WooCommerce Stripe plugin", "<strong>Your shop requires an important security update for the  WooCommerce Stripe plugin</strong>. The fix for this vulnerability was released on July 31. Please update immediately.", "{}", "pending", "woocommerce.com", "2024-01-02 04:42:22", NULL, "0", "plain", "", "0", "0", "info");
INSERT INTO `wp_wc_admin_notes` VALUES("53", "woocommerce-WCStripe-Aug-2023-security-updated", "update", "en_US", "Security update of WooCommerce Stripe plugin", "<strong>Your store has been updated to the latest secure version of the WooCommerce Stripe plugin</strong>. This update was released on July 31.", "{}", "pending", "woocommerce.com", "2024-01-02 04:42:22", NULL, "0", "plain", "", "0", "0", "info");
INSERT INTO `wp_wc_admin_notes` VALUES("54", "woocommerce-WooPayments-Aug-2023-update-needed", "update", "en_US", "Action required: Security update for WooPayments (WooCommerce Payments) plugin", "<strong>Your shop requires an important security update for the WooPayments (WooCommerce Payments) extension</strong>. The fix for this vulnerability was released on July 31. Please update immediately.", "{}", "pending", "woocommerce.com", "2024-01-02 04:42:22", NULL, "0", "plain", "", "0", "0", "info");
INSERT INTO `wp_wc_admin_notes` VALUES("55", "woocommerce-WooPayments-Aug-2023-security-updated", "update", "en_US", "Security update of WooPayments (WooCommerce Payments) plugin", "<strong>Your store has been updated to the more secure version of WooPayments (WooCommerce Payments)</strong>. This update was released on July 31.", "{}", "pending", "woocommerce.com", "2024-01-02 04:42:22", NULL, "0", "plain", "", "0", "0", "info");
INSERT INTO `wp_wc_admin_notes` VALUES("56", "avalara_q3-2023_noAvaTax", "marketing", "en_US", "Automatically calculate VAT in real time", "Take the effort out of determining tax rates and sell confidently across borders with automated tax management from Avalara AvaTax including built-in VAT calculation when you sell into or across the EU and UK. Save time and stay compliant when you let Avalara do the heavy lifting.", "{}", "pending", "woocommerce.com", "2024-01-02 04:42:22", NULL, "0", "plain", "", "0", "0", "info");
INSERT INTO `wp_wc_admin_notes` VALUES("57", "woo-activation-survey-blockers-22AUG23", "info", "en_US", "How can we help you get that first sale?", "Your feedback is vital. Please take a minute to share your experience of setting up your new store and whether anything is preventing you from making those first few sales. Together, we can make Woo even better!", "{}", "unactioned", "woocommerce.com", "2024-01-06 01:44:35", NULL, "0", "plain", "", "0", "0", "info");
INSERT INTO `wp_wc_admin_notes` VALUES("58", "woocommerce-usermeta-Sept2023-productvendors", "update", "en_US", "Your store requires a security update", "<strong>Your shop needs an update to address a vulnerability in WooCommerce.</strong> The fix was released on Sept 15. Please update WooCommerce to the latest version immediately. <a href=\"https://developer.woocommerce.com/2023/09/16/woocommerce-vulnerability-reintroduced-from-7-0-1/\" />Read our developer update</a> for more information.", "{}", "pending", "woocommerce.com", "2024-01-02 04:42:22", NULL, "0", "plain", "", "0", "0", "info");
INSERT INTO `wp_wc_admin_notes` VALUES("59", "woocommerce-STRIPE-Oct-2023-update-needed", "update", "en_US", "Action required: Security update for WooCommerce Stripe Gateway", "<strong>Your shop requires a security update to address a vulnerability in the WooCommerce Stripe Gateway</strong>. The fix for this vulnerability was released on October 17. Please update immediately.", "{}", "pending", "woocommerce.com", "2024-01-02 04:42:22", NULL, "0", "plain", "", "0", "0", "info");
INSERT INTO `wp_wc_admin_notes` VALUES("60", "amazon-mcf-reviews-2023-12-07", "marketing", "en_US", "Enjoying Amazon MCF for WooCommerce?", "We\'re Never Settle, the developers behind Amazon MCF for WooCommerce, and would be deeply honored to have your review. Reviews help immensely as other users can learn how MCF can solve their needs too! Not happy or need help? Please reach out for support and wed love to make things right!", "{}", "pending", "woocommerce.com", "2024-01-02 04:42:22", NULL, "0", "plain", "", "0", "0", "info");
INSERT INTO `wp_wc_admin_notes` VALUES("61", "wc-admin-wc-helper-connection", "info", "en_US", "Connect to Woo.com", "Connect to get important product notifications and updates.", "{}", "unactioned", "woocommerce-admin", "2024-01-02 04:42:23", NULL, "0", "plain", "", "0", "0", "info");
INSERT INTO `wp_wc_admin_notes` VALUES("62", "wc-admin-choosing-a-theme", "marketing", "en_US", "Choosing a theme?", "Check out the themes that are compatible with WooCommerce and choose one aligned with your brand and business needs.", "{}", "unactioned", "woocommerce-admin", "2024-01-03 08:11:04", NULL, "0", "plain", "", "0", "0", "info");
INSERT INTO `wp_wc_admin_notes` VALUES("63", "wc-admin-add-first-product-note", "email", "en_US", "Add your first product", "{greetings}<br /><br />Nice one; you\'ve created a WooCommerce store! Now it\'s time to add your first product and get ready to start selling.<br /><br />There are three ways to add your products: you can <strong>create products manually, import them at once via CSV file</strong>, or <strong>migrate them from another service</strong>.<br /><br /><a href=\"https://woo.com/document/managing-products/?utm_source=help_panel&amp;utm_medium=product\">Trc tip ti liu ca chng ti</a>  bit thm thng tin hoc ch  bt u!", "{\"role\":\"administrator\"}", "unactioned", "woocommerce-admin", "2024-01-04 04:43:49", NULL, "0", "plain", "https://codercoffee.io.vn/wp-content/plugins/woocommerce/images/admin_notes/dashboard-widget-setup.png", "0", "0", "info");
INSERT INTO `wp_wc_admin_notes` VALUES("64", "wc-admin-mobile-app", "info", "en_US", "Install Woo mobile app", "Install the WooCommerce mobile app to manage orders, receive sales notifications, and view key metrics  wherever you are.", "{}", "unactioned", "woocommerce-admin", "2024-01-04 04:43:49", NULL, "0", "plain", "", "0", "0", "info");
INSERT INTO `wp_wc_admin_notes` VALUES("65", "wc-admin-launch-checklist", "info", "en_US", "Ready to launch your store?", "To make sure you never get that sinking \"what did I forget\" feeling, we\'ve put together the essential pre-launch checklist.", "{}", "unactioned", "woocommerce-admin", "2024-01-06 04:42:48", NULL, "0", "plain", "", "0", "0", "info");
INSERT INTO `wp_wc_admin_notes` VALUES("66", "wc-admin-customizing-product-catalog", "info", "en_US", "How to customize your product catalog", "You want your product catalog and images to look great and align with your brand. This guide will give you all the tips you need to get your products looking great in your store.", "{}", "unactioned", "woocommerce-admin", "2024-01-07 04:43:38", NULL, "0", "plain", "", "0", "0", "info");
INSERT INTO `wp_wc_admin_notes` VALUES("67", "wc-admin-usage-tracking-opt-in", "info", "en_US", "Help WooCommerce improve with usage tracking", "Gathering usage data allows us to improve WooCommerce. Your store will be considered as we evaluate new features, judge the quality of an update, or determine if an improvement makes sense. You can always visit the <a href=\"https://codercoffee.io.vn/wp-admin/admin.php?page=wc-settings&#038;tab=advanced&#038;section=woocommerce_com\" target=\"_blank\">Settings</a> and choose to stop sharing data. <a href=\"https://woo.com/usage-tracking?utm_medium=product\" target=\"_blank\">Read more</a> about what data we collect.", "{}", "unactioned", "woocommerce-admin", "2024-01-09 04:42:47", NULL, "0", "plain", "", "0", "0", "info");
INSERT INTO `wp_wc_admin_notes` VALUES("68", "wc-admin-orders-milestone", "info", "en_US", "First order received", "Congratulations on getting your first order! Now is a great time to learn how to manage your orders.", "{\"current_milestone\":1}", "unactioned", "woocommerce-admin", "2024-01-09 04:42:47", NULL, "0", "plain", "", "0", "0", "info");
INSERT INTO `wp_wc_admin_notes` VALUES("69", "remove_estimated_deposits_2024", "marketing", "en_US", "Estimated deposits are going away", "To provide more accurate deposit information and support the expansion of instant deposits, estimated deposit details will no longer be available in WooPayments. We recommend upgrading to the latest version of WooPayments for more detailed balance status information.", "{}", "pending", "woocommerce.com", "2024-01-19 10:30:24", NULL, "0", "plain", "", "0", "0", "info");
INSERT INTO `wp_wc_admin_notes` VALUES("70", "amazon_pay_reactivate_q1-24", "marketing", "en_US", "Special offer: Activate 0% promo rate for Amazon Pay", "For a limited time, Woo merchants who register with Amazon Pay can enjoy a promotional rate of 0% on all transaction fees for 30 days. Valid for businesses based in the United Kingdom. Terms and conditions apply.", "{}", "pending", "woocommerce.com", "2024-01-25 19:47:04", NULL, "0", "plain", "", "0", "0", "info");
INSERT INTO `wp_wc_admin_notes` VALUES("71", "custom_order_attribution_inbox_q1_2024", "marketing", "en_US", "NEW: Custom Order Attribution", "Order attribution tracking is now available for all Woo stores! See whether an order came from a search ad, video, or email. Make better marketing decisions and watch your products go from maybe to must-have.", "{}", "pending", "woocommerce.com", "2024-02-06 04:49:16", NULL, "0", "plain", "", "0", "0", "info");
INSERT INTO `wp_wc_admin_notes` VALUES("72", "wc_admin_UKpricingchange_WCPay_Q1_2024", "marketing", "en_US", "Fee Changes for WooPayments in the EEA and UK", "WooPayments fees for transactions between the EEA and UK will change as of 1st March, 2024. Transactions between the UK and EEA are now deemed by card networks to be cross-border, thus international payment fees will be applicable. This also changes base processing fees.", "{}", "pending", "woocommerce.com", "2024-02-29 19:39:04", NULL, "0", "plain", "", "0", "0", "info");
INSERT INTO `wp_wc_admin_notes` VALUES("73", "airwallex_q1_2024", "marketing", "en_US", "Save big on foreign exchange (FX) fees", "Boost your international sales by offering Apple Pay, Google Pay, and 60+ local payment methods with Airwallex. Save time and money by settling payments directly in USD, EUR, HKD, SGD, AUD, and more  without the extra FX fees. Simple, cost-effective, fast.", "{}", "pending", "woocommerce.com", "2024-02-29 19:39:04", NULL, "0", "plain", "", "0", "0", "info");
INSERT INTO `wp_wc_admin_notes` VALUES("74", "wc-admin-real-time-order-alerts", "info", "en_US", "Get real-time order alerts anywhere", "Get notifications about store activity, including new orders and product reviews directly on your mobile devices with the Woo app.", "{}", "unactioned", "woocommerce-admin", "2024-04-01 04:45:49", NULL, "0", "plain", "", "0", "0", "info");
INSERT INTO `wp_wc_admin_notes` VALUES("75", "wc-admin-manage-orders-on-the-go", "info", "en_US", "Manage your orders on the go", "Look for orders, customer info, and process refunds in one click with the Woo app.", "{}", "unactioned", "woocommerce-admin", "2024-06-30 04:43:58", NULL, "0", "plain", "", "0", "0", "info");
INSERT INTO `wp_wc_admin_notes` VALUES("76", "wc-admin-performance-on-mobile", "info", "en_US", "Track your store performance on mobile", "Monitor your sales and high performing products with the Woo app.", "{}", "unactioned", "woocommerce-admin", "2024-09-28 04:53:20", NULL, "0", "plain", "", "0", "0", "info");
